import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import { connect } from 'react-redux';
import data from './data.json';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      newData: []
    }


  }
  componentDidMount() {
    console.log("this,props",this.props)
    var arr = [];
    for (var i in Object.keys(data.users)) {
      for (var j in Object.values(data.users)) {
      }

      var key = Object.keys(data.users)[i]
      var values = Object.values(data.users)[j]
      arr.push({
        key: key,
        value: values
      })
    }
    this.setState({ newData: arr })
  }


  render() {
    console.log("data", this.state.newData)
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Data saved
        </p>
        </header>
      </div>
    );
  }
}
function mapStateToProps(state) {
  return {
    user: state.user,
  }
}
function mapStateToDispatch(state) {
  return {
    user: state.user,
  }
}
export default connect(mapStateToProps, mapStateToDispatch)(App)
